import React, { useState } from 'react';
import Child from './child';

function Parent() {
  const [count, setState] = useState(0);

  const increment = () => {
    setState((prevState) => {
      count: prevState.count + 1;
    });
  };

  return (
    <div>
      <Child value={count} func={setState} />
    </div>
  );
}

export default Parent;
